function App() {
  return (
    <div className="App">
      <div className="datos">
        <label>Nombre: <input type="text"/></label>
        <label>Apellido: <input type="text"/></label>
        <label>Edad: <input type="text"/></label>
        <label>Tipo Usuario: <input type="text"/></label>
      </div>
    </div>
  );
}

export default App;
